class Solution:
    def addStrings(self, num1, num2):
        """
        :type num1: str
        :type num2: str
        :rtype: str
        """
        number2Str = {}
        str2Number = {}
        for i in range(0, 10):
            number2Str[i] = str(i)
        for i in number2Str:
            str2Number[number2Str[i]] = i
        jinwei = 0
        res = []
        n1 = len(num1)
        n2 = len(num2)
        minN = min([n1, n2])
        maxN = max([n1, n2])
        for i in range(1, minN + 1):
            sumBit = str2Number[num1[-i]] + str2Number[num2[-i]] + jinwei
            jinwei = int(sumBit / 10)
            curBit = sumBit % 10
            res.append(number2Str[curBit])
        if n1 > n2:
            num = num1
        else:
            num = num2
        for i in range(minN + 1, maxN + 1):
            sumBit = str2Number[num[-i]] + jinwei
            jinwei = int(sumBit / 10)
            curBit = sumBit % 10
            res.append(number2Str[curBit])
        if jinwei != 0:
            res.append(number2Str[jinwei])
        res = "".join(reversed(res))
        return res

sol =Solution()
result = sol.addStrings("1", "")
print(result)